import s from './Info.module.css';

const Info = () => {
    return (
        <div className={s.info}>
            <div className={s.photo}>
                <img src='/img/freddie2.jpeg'/>
            </div>

            <div className={s.photoInfo}>
                <h3>Freddie Mercury</h3>

                <ul>
                    <li className={s.key}>Born: <li className={s.discr}>2 September 1946</li></li><br/>
                    <li className={s.key}>City: <li className={s.discr}>London</li></li><br/>
                    <li className={s.key}>Nationality: <li className={s.discr}>British</li></li><br/>
                    <li className={s.key}>Occupation: <li className={s.discr}>singer, songwriter, record producer and lead vocalist of the rock band Queen</li></li>
                </ul>
                {/*<p>*/}
                {/*    <span>Born:</span> 2 September 1946<br/>*/}
                {/*    <span>Nationality:</span> British<br/>*/}
                {/*    <span>City:</span> London<br/>*/}
                {/*    <span>Occupation:</span> singer, songwriter, record producer and lead vocalist of the rock band Queen*/}
                {/*</p>*/}
            </div>
        </div>
    )
}

export default Info;
